  margin-top: 100px;
}
.services h2 {
  padding-left: 15px;
  margin-bottom: 94px;
}
.feature {
  margin-top: 90px;
}
.feat-icon {
  height: 67px;
  width: 67px;
  display: flex;
  justify-content: center;
  align-items: center;
}
.services h3 {
  margin-top: 35px;
  font-size: 24px;
  line-height: 36px;
  font-weight: bold;
