  margin-top: 24px;
  color: var(--clr-txt-p);
  font-size: 16px;
  line-height: 24px;
  margin-bottom: 30px;
}
.rounded {
  background: #ffffff;
  box-shadow: 0px 10px 30px rgba(51, 51, 51, 0.1);
  border-radius: 24px;
  padding: 46px 30px;
  margin-left: 10px;
  margin-right: 10px;
