  margin-top: 100px;
  margin-left: 10px;
  margin-right: 10px;
}
.clients__subtitle {
  color: var(--clr-red);
  font-size: 18px;
  line-height: 27px;
  font-weight: 500;
}
.clients h2 {
  font-size: 36px;
  line-height: 54px;
}
.clients p {
  margin-top: 14px;
  font-size: 16px;
  line-height: 24px;
}

.clients__gallery {
  margin-top: 36px;
  display: grid;
  grid-template-columns: 1fr 1fr;
  grid-template-rows: repeat(4, 80px);
  column-gap: 8px;
  row-gap: 8px;
}

.clients__gallery img {
}
.clients__gallery img:nth-child(1) {
  grid-column: 2/2;
  grid-row: 1/2;
  /* height: 145px;
  width: 145px; */
}
