  grid-column: 2/2;
  grid-row: 3/4;
  /* height: 162px;
  width: 167px; */
}
.clients__gallery img:nth-child(3) {
  grid-column: 1/2;
  grid-row: 2/3;
  /* height: 178px;
  width: 178px; */
