.clients__quote {
  margin-top: 100px;
  font-weight: 500;
  font-size: 24px;
  line-height: 36px;
}

.clients__person-box {
  margin-top: 27px;
  display: flex;
}
.clients__person-box img {
  height: 82px;
  width: 82px;
  border-radius: 12px;
}
.details {
  display: flex;
  margin-left: 30px;
  flex-direction: column;
  justify-content: space-between;
}
.details__name {
  font-weight: 500;
  font-size: 24px;
  line-height: 36px;
  color: var(--clr-txt-black);
}
.details__nickname {
  font-weight: 500;
  font-size: 18px;
  line-height: 27px;
  color: #828282;
}

/* Contact section */
.contact {
  margin-top: 100px;
  background: black;
  padding: 41px 36px;
}
.menu-footer li a {
  color: white;
  text-decoration: none;
  font-size: 18px;
  line-height: 200%;
}

.logo-footer {
  margin-top: 64px;
  font-family: "Heebo", sans-serif;
  color: white;
  font-weight: 800;
  font-size: 36px;
  line-height: 53px;
  color: #f2f2f2;
}

.social {
  display: flex;
  margin-top: 8px;
}
.social-link {
  margin-right: 12px;
}
.form-footer {
  margin-top: 65px;
}
.copyright {
  font-size: 14px;
  line-height: 17px;
  margin-top: 133px;
  color: #a9a9a9;
}

/* Utility */
.full-width {
  left: 50%;
  margin-left: -50vw;
  margin-right: -50vw;
  max-width: 100vw;
  position: relative;
  right: 50%;
  width: 100vw;
}

